import { RequestWrapper } from './Helpers';
export function GenerateAuthToken(devId, apiKey) {
    const requestOptions = {
        method: 'POST',
        headers: {
            'X-API-Key': apiKey,
            'dev-id': devId,
            'Content-Type': 'application/json',
        },
    };
    return RequestWrapper('auth/generateAuthToken', requestOptions);
}
